var util          = require("util");
var RequestHeader = require("../request");

function IfUnmodifiedHeader(value) {
    RequestHeader.call(this, value);
}

util.inherits(IfUnmodifiedHeader, RequestHeader);

IfUnmodifiedHeader.prototype.getKey = function() {
    return "If-Unmodified";
};

module.exports = IfUnmodifiedHeader;
